3	aves_vichada_bio	\N	ceiba	2025-01-16 01:45:38.100781	\N	f	Aves de la desembocadura del caño Teracay en el río Tomo, Puerto Carreño, Vichada - Proyecto Colombia Bio	2019-08-14	I2D-BIO_2018_013. Se presentan las especies de aves registradas y los especímenes recolectados durante una expedición biológica al Caño Terecay, cuenca del Río Tomo, municipio de Puerto Carreño, Vichada, Colombia. Esta es una de las expediciones del proyecto Colombia-BIO. Los registros presentados se derivan de detecciones visuales y auditivas realizados en recorridos diurnos y nocturnos que abarcaron diferentes hábitats dentro del área de estudio. Los listados se encuentran en la plataforma de datos ornitológicos eBird, donde pueden ser consultados y descargados, y alimentan repositorios de datos como el SiB-Colombia y GBIF. Se obtuvieron grabaciones de audio de las aves que serán depositadas en la Colección de Sonidos Ambientales del Instituto Humboldt. Se recolectaron especímenes usando redes de niebla y escopeta neumática de balines, que están depositads y catalogados en la colección IAvH-A. Los microhábitats muestreados fueron georreferenciados con GPS
1	biota_v10_n1-2_10	\N	ceiba	2025-01-16 01:45:38.091812	\N	f	Herpetofauna de la Estrella Fluvial de Inírida (ríos Inírida, Guaviare, Atabapo y Orinoco), Orinoquia colombiana: lista preliminar de especies	2017-05-16	I2D-BIO_2015_074. Con base en una evaluación rápida de campo realizada durante la estación seca (febrero 2008) en la Estrella Fluvial de Inírida (confluencia de los ríos Guaviare, Inírida, Atabapo y Orinoco), revisión de los decomisos faunísticos de las corporaciones regionales y análisis bibliográfico, se consolida un listado herpetológico preliminar. Fueron identificadas 62 especies, 31 para la clase Amphibia y 31 para Reptilia. La clase Amphibia está representada por el orden Anura y seis familias, siendo Hylidae la más diversa (12 sp.), seguida de Leptodactylidae (10 sp.). La clase Reptilia incluyó tres órdenes (Crocodylia, Squamata y Testudines), con 12 familias. Las familias más ricas fueron Colubridae (6 sp.) y Podocnemididae (5 sp.). Probablemente la riqueza global de la herpetofauna del área de la Estrella Fluvial de Inírida supere las 100 especies. Siete especies tienen algún grado de amenaza, en especial, las tortugas acuáticas.
