2	cacay-moriche_guaviare	\N	ceiba	2025-01-16 01:45:38.097256	\N	f	Abundancia, estructura poblacional y registro de producción de frutos de cacay (Caryodendron orinocense) y moriche (Mauritia flexuosa) en el departamento del Guaviare	2024-10-25	I2D-BIO_2024_011. El presente registro contiene la información biológica de productividad y estructura ecológica de la especie Cacay en los municipios de San José del Guaviare, El Retorno y Calamar en el derpartamento del Guaviare para la elaboración del protocolo para el aprovechamiento sostenible de esta especie.
5	doi:10.21068/WK1KS4	\N	biocultural	2025-04-10 13:01:45.330578	\N	f	Evaluación de Impactos Ambientales y Sociales de la implementación del proyecto GEF- Páramos en la región Boyacá	2024-11-07	A través de talleres, recorridos territoriales y espacios participativos con comunidades campesinas y organizaciones de base comunitaria de la región Boyacá en los municipios Tota, Mongua (Complejo de páramo Tota Bijagual Mamapacha), Gámeza, Tasco, Socha (Complejo de páramo Pisba) y Güicán de la Sierra (Complejo de páramo Sierra Nevada del Cocuy), se recogieron las percepciones y aportes sobre los posibles impactos que las acciones del proyecto GEF-Páramos para la vida puede generar sobre su territorio, con el fin de plantear de manera participativa con las comunidades medidas de manejo para su control y mitigación. Lo anterior como un ejercicio de Salvaguarda Social y Ambiental establecida en el marco de los Estándares Sociales y Ambientales del Programa de las Naciones Unidas para el Desarrollo - PNUD.
